import React from 'react';

export default function New() {
  const [company, setCompany] = userState('');
  const [techs, setTechs] = userState('');
  const [price, setPrice] = userState('');


  function handleSubmit() {

  }

  return (
    <form onSubmit={handleSubmit}>
      <label htmlFor="company">Empresa *</label>
      <input 
        id="company" 
        placeholder="Sua empresa" 
        value={company}  
        onChange={event => setCompany(event.target.value)}
      />
      <label htmlFor="tech">Tecnologias *<span>(separadas por virgula)</span></label>
      <input 
        id="techs" 
        placeholder="Quais tecnologias usam?" 
        value={techs}  
        onChange={event => setTechs(event.target.value)}
      />
      <label htmlFor="price">Valor da Di√°ria *<span>(Em branco para Gratuito)</span></label>
      <input 
        id="price" 
        placeholder="Valor cobrado por dia?" 
        value={price}  
        onChange={event => setPrice(event.target.value)}
      />
      <button className="btn">Cadastrar</button>
    </form>
  )
}
